import React, { useEffect, useState } from 'react';
import { makeStyles, withStyles } from '@material-ui/core/styles';
import { Container, Button, Typography } from '@material-ui/core';
import LinearProgress from '@material-ui/core/LinearProgress';
import axios from 'axios';
import Box from '@material-ui/core/Box';

const styles = {
  root: {
    flexGrow: 1,
    textAlign: "center"
  },
  container:{
  }

};

const useStyles = makeStyles(styles); 


const BorderLinearProgress = withStyles((theme) => ({
  root: {
    height: 20,
    borderRadius: 10,
  },
  colorPrimary: {
    backgroundColor: theme.palette.grey[theme.palette.type === 'light' ? 200 : 700],
  },
  bar: {
    borderRadius: 10,
    backgroundColor: '#1a90ff',
  },
}))(LinearProgress);




export default function Result() {
  const classes = useStyles();
  const apiUrl = '/test/responseScore'
  const [score, setScore] = useState();
  const [name, setName] = useState();
  const [region, setRegion] = useState();
  const [age, setAge] = useState();


  useEffect(() => {
    /* awards get */
    const getScore = () => {
      axios.get(apiUrl+"?user_id=1", {})
        .then(response => {
          setScore(response.data.result[0].score);
          setName(response.data.result[0].user_name);
          setRegion(response.data.result[0].user_region_nm);
          setAge(response.data.result[0].user_age_nm);

          console.log(response.data)

        })
    }
      getScore();
  }, [])


  return (
    <Container className={classes.root}>

      {/* 심리검사 결과 안내 페이지 */}

      <br />
      <br />
      <br />

      <br />

      <h2>{name}님의 안녕지수는 {score}점 /60 입니다. </h2>

      <br />
      <Box display="flex" alignItems="center">
        <Box minWidth={35}>
          <Typography variant="body2" color="textSecondary">{`${Math.round(
            0,
          )}`}</Typography>
        </Box>
        <Box width="100%" mr={1}>
          <BorderLinearProgress variant="determinate" value={score/60*100} />
        </Box>
        <Box minWidth={35}>
          <Typography variant="body2" color="textSecondary">{`${Math.round(
            60,
          )}`}</Typography>
        </Box>
      </Box>
      <br />
      <br />
      <br />

      우울감을 겪는 사람들 중 약 60%는 대화를 통해, <br />
      혹은 전문가들과 심리 상담을 통해 짧은 시간 안에 해결이 되었다고 해요!<br /> 
      <br />
      지금 바로 상담가와 편하게 대화를 나누어보세요!<br />
      {name}님은 약간 우울한 상태에 해당하시네요.<br />
      그동안 말 못할 사정이 있진 않으셨나요?<br />
      <br />
      우울감을 겪는 사람들 중 약 60%는 대화를 통해, <br />
      혹은 전문가들과 심리 상담을 통해 짧은 시간 안에 해결이 되었다고 해요! 
      <br /><br />
      지금 바로 상담가와 편하게 대화를 나누어보세요!
      <br />
      <br />
      <br />

      <Button variant="outlined" color="primary">
      상담하기</Button>
      <br />
      <br />
      <br />
      <br />

      <h3><strong>{name}</strong>님이 살고 계신 <strong>{region}</strong>의 안녕지수를 확인해보세요! </h3>
      <br />
      지역 시각화 지도를 올리기 
      <br />
      <br />

      <h3><strong>{name}</strong>님의 또래 <strong>{age}</strong>의 안녕지수를 확인해보세요! </h3>
      <br />
      연령별 시각화 자료 
      <br />
      <br />

      <h3>남/녀 안녕지수를 확인해보세요! </h3>
      <br />
      성별 데이터 시각화 자료
      <br />
      <br />

      <br />
      <br />
      <br />


    </Container>
  );

}
